import styled from "styled-components";

const withProps = (Component, { children, ...props }) =>
  styled(<Component {...props}>{children}</Component>);

const Button = ({ type, ...props }) => {
  console.log(Small);
  switch (type) {
    case "Big":
      return withProps(Big, props);
      break;
    case "Small":
      return withProps(Small, props);
      break;
    default:
      return withProps(Small, props);
  }
};

const Small = styled.button``;

const Big = styled.button``;

export default Button;
